import React from "react";
import ForecastResult from "./ForecastResult";

class Forecast extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      mappedResult: null
    };
  }

  mapForecastResult = item => <ForecastResult key={item.id} result={item} />;

  componentDidMount() {
    {
      var result = this.props.result.list.map(this.mapForecastResult);
      this.setState({
        mappedResult: result
      });
    }
  }

  render() {
    return (
      <div className="col-6">
        <h4>5 day Forecast</h4>
        <table className="table">
          <tbody>
            <tr>
              <th scope="col">Datetime</th>
              <th scope="col">Temp</th>
              <th scope="col">High</th>
              <th scope="col">Low</th>
              <th scope="col">Weather</th>
              <th scope="col"></th>
            </tr>
            <tr>
              <td>2019-12-05</td>
              <td>55.6</td>
              <td>54.91</td>
              <td>55.6</td>
              <td>broken cloud</td>
              <td>
                <img
                  src={`http://openweathermap.org/img/wn/04n@2x.png`}
                  alt="weather-icon"
                  style={{ width: "75%" }}
                />
              </td>
            </tr>
          </tbody>
        </table>
      </div>
    );
  }
}

export default Forecast;
